From ⚡energy to 🏥healthcare;
➡️⛽gas to 🛒groceries;
➡️💰property taxes to 💊Rx drugs;
➡️☕coffee to 🍼child care;
#Trumpflation is jacking up your costs. To pay for what? A corrupt handout to billionaires and big corporations. Proud to stand with @MomsRising to make our economy work for hardworking people.

The System Operators of @IBEW1837 work around the clock to bring power to people across New Hampshire.  

The work they do is hard and mission-critical. The electric grids they are entrusted with operating are absolutely vital to the health, safety, and economic security of people across New Hampshire. 

@EversourceNH: It’s time to bargain in good faith and deliver a fair contract!

New Hampshire’s small businesses are leading the world in innovation. That includes GEOKON, a Lebanon-based manufacturer of sensors that are mission-critical in civil and structural engineering projects across America and all around the world. 

At a moment when venture capitalists are consolidating corporate power at dangerous speeds, GEOKON bucked that bad trend and placed its ownership entirely in the hands of the people who work there.  

@NHkaren and I had an impactful conversation in Lebanon with the people at the heart of this 100% employee-owned NH manufacturer. One key takeaway: the future of manufacturing in our state depends on making housing and childcare affordable and accessible. That’s what I’m fighting to do in Congress.
